(509, 112, '', 'Agency Subscription Reminder - Before 5 Days, Before 1 Day', '<p>Hi Brainne,<br />\r\n<br />\r\nYour Basic subscription will be deactivated on 20-09-2020.<br />\r\n<br />\r\nIn order not to lose any of your work, please updated your plan directly on your dashboard.<br />\r\n<br />\r\nIf you need any assistance please feel free to reach out to our experts.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', NULL, '3', NULL, 1, '2020-09-15 00:00:06', '2020-09-15 00:01:04'),
(510, 112, '', 'Agency Subscription Reminder - Before 5 Days, Before 1 Day', '<p>Hi Brainne,<br />\r\n<br />\r\nYour Basic subscription will be deactivated on 20-09-2020.<br />\r\n<br />\r\nIn order not to lose any of your work, please updated your plan directly on your dashboard.<br />\r\n<br />\r\nIf you need any assistance please feel free to reach out to our experts.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', NULL, '3', NULL, 1, '2020-09-15 00:00:06', '2020-09-15 00:01:05');
INSERT INTO `email_master` (`id`, `title`, `parameters`, `subject`, `content`, `created_date`, `updated_date`) VALUES
(1, 'Admin Forgot Password', 'NAME,NUMBER', 'Admin Forgot Password', '<p>Hi {{NAME}},</p>\r\n\r\n<p>You have recently requested to reset your password. Please find your OTP below:&nbsp;</p>\r\n\r\n<p>{{NUMBER}}</p>\r\n\r\n<p>If you did not make this request, no further action is required. Thank you, RealtorHubs Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>RealtorHubs Team</p>', '2020-07-13 06:00:00', '2020-08-04 14:06:54'),
(2, 'Password Change', '', 'Change Password', '<p>Hi ,<br />\r\n<br />\r\nYour password has been changed successfully.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-13 00:00:00', '2020-08-04 14:07:54'),
(3, 'Agency Forgot Password', 'NAME,NUMBER', 'Agency Forgot Password', '<p>Hi {{NAME}},</p>\r\n\r\n<p>You have recently requested to reset your password. Please find your OTP below:<br />\r\n<br />\r\n{{NUMBER}}<br />\r\n<br />\r\nIf you did not make this request, no further action is required.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2020-07-13 06:00:00', '2020-08-04 14:04:40'),
(4, 'Verification', 'OTP', 'Verification', '<p>Hi {{USER_NAME}},</p>\n\n<p>Your one-time verification code is:<strong>{{OTP}}</strong></p>\n\n<p>To complete your account setup successfully, enter the code in your browser to verify your account.</p>\n\n<p>Thank you,<br />\nRealtorHubs Team</p>', '2020-07-16 00:00:00', '2020-09-07 14:47:45'),
(5, 'New Account Create', 'PASSWORD', 'Your Agent Profile is Created', '<p>Hi,<br />\r\n<br />\r\nYour profile is created please click on the button: {{PASSWORD}} and set your password.<br />\r\n<br />\r\nPlease let us if you have any doubts once after you explore the system.</p>\r\n\r\n<p><br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-16 00:00:00', '2020-08-19 09:38:00'),
(6, 'Deactivated Account', 'USERNAME', 'Agency Deactivate Account', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {{USERNAME}} Admin,<br />\r\n<br />\r\n{{USERNAME}} would like to deactivate their account.<br />\r\n<br />\r\nThis is just a notification. No action is needed.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-22 00:00:00', '2020-08-04 14:00:37'),
(7, 'update plan', 'AGENCY_NAME', 'Update Plan', '<p>Hello {{AGENCY_NAME}},</p>\r\n\r\n<p>Your Plan has successfully updated.</p>\r\n\r\n<p>ha</p>\r\n\r\n<p>Thanks, Realtorhubs</p>', '2020-07-22 00:00:00', '2020-07-30 05:56:36'),
(8, 'Agency Edit Profile - Change Email OTP', 'OTP', 'Agency Edit Profile - Change Email OTP', '<p>Hi,<br />\r\n<br />\r\nHere is your temporary password: {{OTP}}<br />\r\n<br />\r\nPlease use this password for initial login.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-16 00:00:00', '2020-08-06 05:44:44'),
(9, 'Agency Deactivate Agent Account', 'AGENTNAME,AGENCYNAME', 'Agency Deactivate Agent Account', '<p>Hi {{AGENTNAME}},<br />\r\n<br />\r\nYour account has been deactivated by {{AGENCYNAME}}.<br />\r\n<br />\r\nPlease contact your Agency for more information.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-16 00:00:00', '2020-08-04 13:58:39'),
(10, 'Agency Completed Profile', 'AGENCYNAME', 'Agency Completed Profile', '<p>Hi {{AGENCYNAME}},</p>\r\n\r\n<p>Your RealtorHubs profile has been setup successfully.<br />\r\n<br />\r\nPlease let us know if you have any questions as you explore!<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-04 10:35:17'),
(11, 'Agency Subscription Reminder - Before 5 Days, Before 1 Day', 'AGENCYNAME,PLANNAME,DATE', 'Agency Subscription Reminder - Before 5 Days, Before 1 Day', '<p>Hi {{AGENCYNAME}},<br />\r\n<br />\r\nYour {{PLANNAME}} subscription will be deactivated on {{DATE}}.<br />\r\n<br />\r\nIn order not to lose any of your work, please updated your plan directly on your dashboard.<br />\r\n<br />\r\nIf you need any assistance please feel free to reach out to our experts.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-06 06:23:29'),
(12, 'Agency Payment Failed', 'AGENCYNAME,PLANNAME', 'Agency Payment Failed', '<p>Dear {{AGENCYNAME}},<br />\r\n<br />\r\nYour payment has failed for {{PLANNAME}}&nbsp;plan.<br />\r\n<br />\r\nPlease update your payment information directly through your dashboard or feel free to contact our experts.<br />\r\n<br />\r\nIf you have any questions or concerns, feel free to reach out to us!<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-04 14:22:39'),
(13, 'Agency Payment Failed-Admin', 'AGENCYNAME,PLANNAME', 'Agency Payment Failed', '<p>Dear Admin, {{AGENCYNAME}} Upgrading or Degrading {{PLANNAME}} payment has been failed. Thank You Team Realtor</p>', '2020-07-29 00:00:00', '2020-07-30 06:11:31'),
(17, 'Agency Upgrade or Download Grade-Admin', 'AGENCYNAME,PLANNAME', 'Agency Upgrade or Download Grade', 'Dear Admin,\r\n\r\n{{AGENCYNAME}} Upgrading or degrading  {{PLANNAME}}  has been suceesfully activated..\r\n\r\n\r\nThank You\r\nTeam Realtor', '2020-07-29 00:00:00', '2020-07-29 10:49:26'),
(18, 'Agent Profile Setup Complete', 'AGENTNAME', 'Agent Profile Setup Complete', '<p>Dear {{AGENTNAME}},</p>\r\n\r\n<p>Your profile setup has been Sucessfully completed.</p>\r\n\r\n<p>Please let us know if you have any questions while using the system.</p>\r\n\r\n<p>Thank You Team</p>\r\n\r\n<p>Realtor Hub</p>', '2020-07-29 00:00:00', '2020-08-26 06:39:39'),
(19, 'Agency Deactivate Account-Admin', 'AGENCYNAME', 'Agency Deactivate Account', '<p>Hi&nbsp; {{AGENCYNAME}},<br />\n<br />\nYour account has been successfully deactivated.<br />\n<br />\nTo reactivate your account, please contact our experts directly through&nbsp;<a href=\"https://www.google.com/url?q=http://realtorhubs.com&amp;sa=D&amp;ust=1596551675099000&amp;usg=AFQjCNFlPvS1KxBFmLcGDlhEdYPuoAIbpg\" target=\"_blank\">realtorhubs.com</a>.<br />\n<br />\nThank you,<br />\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-06 06:35:25'),
(20, 'Agency Upgrade or Download Grade-Agency', 'AGENCYNAME', 'Agency Upgrade or Download Grade', '<p>Hi {{AGENCYNAME}},<br />\r\n<br />\r\nYou have successfully updated your subscription.<br />\r\n<br />\r\nIf you have any questions or concerns, feel free to reach out to us!<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-06 06:26:43'),
(21, 'Admin Delete Subscription Plan', 'AGENCYNAME', 'Admin Delete Subscription Plan', '<p>Hi {{AGENCYNAME}},<br />\r\n<br />\r\nYour active subscription has been deleted by admin please change your subscription plan to continue using the system\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-06 06:26:43'),
(22, 'Agency Subscription Renew ', 'AGENCYNAME,PLANNAME', 'Agency Subscription Renew', '<p>Dear {{AGENCYNAME}},<br />\r\n<br />\r\nYour Subscription has renew for {{PLANNAME}}&nbsp;plan.<br />\r\n\r\nIf you have any questions or concerns, feel free to reach out to us!<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-04 14:22:39'),
(23, 'New Contact Form Lead-Agency', 'USERNAME,PROPERTYID,PROPERTYADDRESS,NAME,EMAIL,PHONE,MESSAGE', 'New Contact Form Lead', '<p>Hello {{USERNAME}},<br />\n<br />\nYou have a new lead.<br />\nContact form details<br />\nProperty Id: {{PROPERTYID}}<br />\nProperty Address: {{PROPERTYADDRESS}}<br />\nName: {{NAME}}<br />\nEmail: {{EMAIL}}<br />\nPhone No: {{PHONE}}<br />\nMessage: {{MESSAGE}}<br />\nThank you,<br />\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-08-27 13:05:14'),
(24, 'New Contact Form Lead-Agent', 'USERNAME,PROPERTYID,PROPERTYADDRESS,NAME,EMAIL,PHONE,MESSAGE', 'New Contact Form Lead', '<p>Hello {{USERNAME}},<br />\n<br />\nYou have a new lead.<br />\nContact form details<br />\nProperty Id: {{PROPERTYID}}<br />\nProperty Address: {{PROPERTYADDRESS}}<br />\nName: {{NAME}}<br />\nEmail: {{EMAIL}}<br />\nPhone No: {{PHONE}}<br />\nMessage: {{MESSAGE}}<br />\nThank you,<br />\nRealtorHubs Team</p>', '2020-07-29 00:00:00', '2020-09-08 13:08:07'),
(25, 'Contact Us', 'NAME,CONTACTNAME,CONTACTEMAIL,MESSAGE', 'Contact US', '<p>Hello <strong>{{NAME}},</strong><br />\r\n<br />\r\n<strong>Name:</strong> {{CONTACTNAME}}<br />\r\n<strong>Email: </strong> {{CONTACTEMAIL}}<br />\r\n<strong>Message: </strong> {{MESSAGE}}</p>\r\n\r\n<p>Thank you,<br />\r\nRealtorHubs Team</p>', '2020-08-31 00:00:00', '2020-09-01 04:37:51'),
(26, 'Customer Forgot Password', 'NAME,NUMBER', 'Customer Forgot Password', '<p>Hi {{NAME}},</p>\n\n<p>You have recently requested to reset your password. Please find your OTP below:<br />\n<br />\n{{NUMBER}}<br />\n<br />\nIf you did not make this request, no further action is required.<br />\n<br />\nThank you,<br />\nRealtorHubs Team&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\n\n<p>&nbsp;</p>', '2020-07-13 06:00:00', '2020-09-04 07:06:29'),
(27, 'Customer Edit Profile - Change Email OTP', 'OTP', 'Customer Edit Profile - Change Email OTP', '<p>Hi {{USER_NAME}},<br />\r\n<br />\r\nHere is your temporary password: {{OTP}}<br />\r\n<br />\r\nPlease use this password for initial login.<br />\r\n<br />\r\nThank you,<br />\r\nRealtorHubs Team</p>', '2020-07-16 00:00:00', '2020-09-03 14:13:35'),
(28, 'Customer Deactivated Account- Agency', 'USERNAME,AGENCYNAME', 'Customer Deactivate Account', '<p>Hi {{AGENCYNAME}},<br />\n<br />\n{{USERNAME}} would like to deactivate their account.<br />\n<br />\nThis is just a notification. No action is needed.<br />\n<br />\nThank you,<br />\nRealtorHubs Team</p>', '2020-07-22 00:00:00', '2020-09-04 07:42:16'),
(29, 'Customer Deactivate Account-Customer', 'USERNAME', 'Customer Deactivate Account', 'Hi  {{USERNAME}},\n\nYour account has been successfully deactivated.\n\nTo reactivate your account, please contact our experts directly through realtorhubs.com.\n\nThank you,\nRealtorHubs Team', '2020-07-29 00:00:00', '2020-09-04 07:39:32'),
(30, 'Send General Email To Customer', 'USERNAME,MESSAGE,AGENCYNAME', 'Must See - Property Options', '<p>Hello&nbsp;{{USERNAME}},</p>\n\n<p>As per our observation you may be interested in this property. test</p>\n\n<p>{{MESSAGE}}</p>\n\n<p>Thank you,<br />\n{{AGENCYNAME}}</p>', '2020-09-10 00:00:00', '2020-09-14 06:13:05'),
(31, 'Send Favourite Property Email To Customer', 'USERNAME,MESSAGE,AGENCYNAME', 'Must See - Your favourite properties', '<p>Hello&nbsp;{{USERNAME}},</p>\n\n<p>As per our observation you may be interested in this property.<br />\n<br />\n{{MESSAGE}}</p>\n\n<p>Thank you,<br />\n{{AGENCYNAME}}</p>', '2020-09-10 00:00:00', '2020-09-14 06:12:57'),
(32, 'Send Email Fro Unread Message', 'USERNAME,USERIMAGE,USERNAME,URL,AGENCYNAME', '{{USERNAME}} sent a new message', 'You have a new message \n\n {{USERIMAGE}}\n {{USERNAME}}\n {{URL}}\n\n <p>Thank you,<br />\n{{AGENCYNAME}}</p>', '2020-09-10 00:00:00', '2020-09-14 10:23:09');
