(6, 'add webinar update', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown.', '1', 7, '2020-09-01 11:10:13', '2020-09-01 10:27:55'),
(7, 'New Faq for test1', 'New Faq for test description1', '1', 6, '2020-09-01 15:56:25', '2020-09-01 10:27:19'),
(8, 'Software Application Development Company', '<p>If you are a <strong>budding</strong> entrepreneur mulling over an idea for sometimes, you are in the right place. We will share your job, understand you and your business ecosystem, brainstorm and then shape your dream together. If you are an executive in an enterprise, worried about proper technological tool which can provide you operational control and decision making ability, you are in the right place.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p><em><strong>We will research and build the right algorithm for you. If you are the head of a charitable organization, want to bring transparency through practices; you are in the right place.</strong></em></p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>We will help you lay down a process that will help you attain your goal. Be it a complex process mapping or just an informative presentation, Technource, powered by its Agile development processes always ensures Quality, Performance, Appeal and Business for you.</strong></p>', '1', 0, '2020-09-02 11:23:42', '2020-09-02 11:53:03');
