(114, 57, 'agency_text', '<p>&nbsp;</p>\r\n\r\n<p><em>An About Us page is an&nbsp;essential lead generation tool for&nbsp;a real estate website. But it so happens that it&rsquo;s one of the most neglected pages too. As your digital representative, a remarkable real estate About Us page works to generate you leads 24/7. If you need to improve yours, here&rsquo;s a step-by-step guide to&nbsp;writing a really good one.&nbsp;</em></p>\r\n\r\n<p>It&rsquo;s very likely that most people visiting a real estate About Us page are qualified leads. So it helps to think of this page as your virtual business card. The better it answers the questions people have, the better impression it would make.</p>\r\n\r\n<p>It&rsquo;s a good idea to grasp the questions your visitors have before drafting your copy:</p>\r\n\r\n<ul>\r\n	<li>what is this agency all about? what do they specialize in?</li>\r\n	<li>how long have the company been working on this market?</li>\r\n	<li>where are they located and which areas do they serve?</li>\r\n	<li>what makes them special?</li>\r\n	<li>what are the core values of the team?</li>\r\n	<li>why should I contact this company and not their competition?</li>\r\n</ul>\r\n\r\n<p>In other words, you have to showcase your achievements, affiliations and skills and do so in a way that would compel people to get in touch.</p>\r\n\r\n<p>Here&rsquo;s a quick recap of some helpful things to get you started.</p>\r\n\r\n<h2>How to structure a real estate About Us page</h2>\r\n\r\n<p><strong>Quick introduction&nbsp;</strong></p>\r\n\r\n<p>Describe your background and what has led you to join the real estate industry. Is this a family business you&rsquo;ve taken over? Your own&nbsp;venture you&rsquo;ve been dreaming of launching since college? Have you moved from abroad and so can boast a deep understanding of how the business works in different settings?</p>\r\n\r\n<p>This section shouldn&rsquo;t be too long but don&rsquo;t be afraid to say more, if you have important things to mention. Just make sure to break your text into smaller paragraphs to make it more presentable.</p>\r\n\r\n<p><strong>Skills and expertise</strong></p>\r\n\r\n<p>If your list of professional accomplishments is long enough, it might make sense to create a separate page to showcase them. You can then link to it from your About Us page. If not, make a nice list right in the&nbsp;page itself.</p>\r\n\r\n<h3>Our team</h3>\r\n\r\n<p>If your team is big enough, you may want to create a separate page, then link to it from About Us page.</p>', 'text', '2020-09-09 15:15:41', '2020-09-09 09:45:41'),
