(179, 1, 'contact_us_email', 'sales@digiteau.com', 'text', '2020-09-11 02:49:02', '2020-09-10 21:19:02'),
(180, 1, 'contact_us_sub_heading', 'How can we help you?', 'text', '2020-09-11 02:49:02', '2020-09-10 21:19:02'),
(181, 1, 'contact_us_heading', 'Contact Us', 'text', '2020-09-11 02:49:02', '2020-09-10 21:19:02'),
(182, 1, 'about_believe_title', 'What is Realtorhubs?', 'text', '2020-09-11 03:11:24', '2020-09-10 21:41:24'),
(183, 1, 'about_beleive_title1', 'Realtorhubs, a cloud-based software, where you (a real estate agency) can have all your properties in one centralized space, communicate with customers and leads.', 'text', '2020-09-11 03:11:24', '2020-09-10 21:41:24'),
(184, 1, 'about_believe_description', 'By using Realtorhubs you can have your very own property marketing platform, where customers can visit and chat with your agents in real-time.  Let us help you connect with your buyers and sellers.', 'text', '2020-09-11 03:11:24', '2020-09-10 21:41:24'),
(185, 1, 'about_mission_title', 'What We Believe', 'text', '2020-09-11 03:12:14', '2020-09-10 21:42:14'),
(186, 1, 'about_mission_desctiption1', 'Sharing and communication should come with ease. Realtorhubs is inspired by our founder’s personal experience - buying and selling properties, finding the right agent and overcoming communication barriers.', 'text', '2020-09-11 03:12:14', '2020-09-10 21:42:14'),
(187, 1, 'about_mission_desctiption2', 'We wanted to ease the communication between agent and buyer/ seller by creating a user-friendly, customizable platform allowing realtors to directly communicate with buyers and sellers, display their properties on a map and more, all in a centralized hub.  It\'s as easy as creating an account, adding your agents and their properties.', 'text', '2020-09-11 03:12:14', '2020-09-10 21:42:14'),
(188, 1, 'about_meta_seo_title', 'Realtor Hubs About SEO Title', 'text', '2020-09-02 16:30:50', '2020-09-02 11:00:50'),
